document.addEventListener("DOMContentLoaded", () => {
  const params = new URLSearchParams(window.location.search);
  const idBuscat = params.get("id");
  const container = document.getElementById("detall");

  
  const IMATGES = {
    "G001": "data:image/jpeg;base64,",
    "G002": "data:image/jpeg;base64,",
    "G003": "data:image/jpeg;base64,",
    "G004": "data:image/jpeg;base64,",
    "G005": "data:image/jpeg;base64,",
    "G006": "data:image/jpeg;base64,",
    "G007": "data:image/jpeg;base64,"
  };

  if (!idBuscat) {
    container.innerHTML = "<p>No s'ha especificat cap element del catleg.</p>";
    return;
  }

  fetch("dades.xml")
    .then(res => res.text())
    .then(str => new window.DOMParser().parseFromString(str, "text/xml"))
    .then(xml => {
      const jocs = xml.getElementsByTagName("joc");
      let trobat = false;

      for (let joc of jocs) {
        if (joc.getAttribute("id") === idBuscat) {
          trobat = true;

          const titol = joc.getElementsByTagName("titol")[0].textContent;
          const genere = joc.getElementsByTagName("genere")[0].textContent;
          const any = joc.getElementsByTagName("any")[0].textContent;
          const plataforma = joc.getElementsByTagName("plataforma")[0].textContent;
          const preu = joc.getElementsByTagName("preu")[0].textContent;
          const valoracio = joc.getElementsByTagName("valoracio")[0].textContent;
          const desc = joc.getElementsByTagName("descripcio")[0].textContent;
          const imgSrc = IMATGES[idBuscat] || "img/placeholder.jpg";

          container.innerHTML = `
            <article class="fitxa">
              <h1>${titol}</h1>
              <img src="${imgSrc}" alt="Portada de ${titol}">
              <p><strong>Gnere:</strong> ${genere}</p>
              <p><strong>Any:</strong> ${any}</p>
              <p><strong>Plataforma:</strong> ${plataforma}</p>
              <p><strong>Preu aproximat:</strong> ${preu} </p>
              <p><strong>Valoraci:</strong> ${valoracio}</p>
              <p><strong>Descripci:</strong> ${desc}</p>
              <a href="index.html"> Tornar al catleg</a>
            </article>
          `;
          break;
        }
      }

      if (!trobat) {
        container.innerHTML = "<p>No s'ha trobat el videojoc demanat.</p>";
      }
    })
    .catch(err => {
      console.error("Error carregant dades.xml", err);
      container.innerHTML = "<p>S'ha produt un error carregant les dades.</p>";
    });
});
